import React from 'react';
import PropTypes from 'prop-types';

import './topbar.scss'
import { api } from '../../assets/images/api';



function Topbar(props) {
  return(
    <div className='ui-topbar' >
        <div className="ui-topbar__left">
            <i className="ui-topbar__left__icon fab fa-facebook-square"></i>
            <i className="ui-topbar__left__icon fab fa-twitter-square"></i>
            <i className="ui-topbar__left__icon fab fa-pinterest-square"></i>
            <i className="ui-topbar__left__icon fab fa-linkedin"></i>

        </div>
        <div className="ui-topbar__center">
            <ul className="ui-topbar__center__list">
                <li className="ui-topbar__center__list__item">HOME</li>
                <li className="ui-topbar__center__list__item">ABOUT</li>
                <li className="ui-topbar__center__list__item">CONTACT</li>
                <li className="ui-topbar__center__list__item">WRITE</li>
                <li className="ui-topbar__center__list__item">LOGOUT</li>
            </ul>
            <api />
        </div>
        <div className="ui-topbar__right">
            {/* <i className="ui-topbar__right__userIcon fas fa-user-circle"></i> */}
            <i className="ui-topbar__right__searchIcon fas fa-search"></i>
            <img src='http://localhost:3000/p-icon-jpg' alt='Profile Pic' />
        </div>
    </div>
  );
}

Topbar.propTypes = {};

export default Topbar;
